import React from 'react';
import './App.css';
import ListaCards from "./components/Listacards";
import { Switch, Router,Route } from 'react-router-dom';
//import firebase from "./firebase";

function App() {


       return (
         <Router>
       <>
           <Switch>

      <Route path='/home' component={ListaCards} />     

       </Switch>
        </>
        </Router>
    );

}   

export default App;
